  "Broker Comment" : "ON MAY 7, 1986 A \"COMPLAINT-CRIMINAL (FELONY)\" WAS ISSUED BY THE STATE OF CALIFORNIA AGAINST KENNETH H. WILLIAMS, ET. AL., CASE NO. F 096545, DA NO. A99588, IN WHICH IT WAS CHARGED THAT WILLIAMS, DANIEL L. PULVERS, CHESTER W. NIEBRUGGE, JAMES T. STEWART, AND JEFFREY M. CHEYNE ON OR ABOUT MAY 2, 1980 \"DID WILLFULLY OFFER TO SELL AND ISSUE AND CAUSE TO BE SOLD AND ISSUED TO JAMES J. AND HAZEL G. BIVENS, A SECURITY, TO WIT, A FRACTIONALIZED INTEREST IN A TRUST DEED KNOWN AS TWENY-ONE THIRTY-ONE LTD., WITHOUT HAVING FIRST APPLIED FOR AND SECURED FROM THE COMMISSIONER OF CORPORATIONS OF THE STATE OF CALIFORNIA, A QUALIFICATION OF SUCH SECURITY AND TRANSACTION AS REQUIRED BY CALIFORNIA CORPORATIONS CODE SECTION 25110, IN VIOLATION OF CALIFORNIA CORPORATIONS CODE SECTION 25540. (COUNT TWO): ON OR ABOUT OCTOBER 9, 1980, DANIEL L. PULVERS, CHESTER W. NIEBRUGGE, JAMES T. STEWART, KENNETH H. WILLIAMS, AND JEFFREY N. CHEYNE DID WILFULLY OFFER TO SELL AND ISSUE AND CAUSE TO BE SOLD AND ISSUED TO JAMES L. AND ZEPHA L. DOHERTY, A SECURITY, TO WIT, A LIMITED PARTNERSHIP INTEREST IN A LIMITED PARTNERSHIP KNOWN AS TWENTY-ONE THIRTY-ONE LTD., WITHOUT HAVING FIRST APPLIED FOR AND SECURED FROM THE COMMISSIONER OF CORPORATIONS OF THE STATE OF CALIFORNIA A QUALIFICATION OF SUCH SECURITY AND TRANSACTION AS REQUIRED BY CALIFORNIA CORPORATIONS CODE SECTION 25110, IN VIOLATION OF CALIFORNIA CORPORATIONS CODESECTION 25540.\" WILLIAMS WAS FOUND GUILTY OF THE REDUCED CHARGE OF A MISDEMEANOR VIOLATION OF CALIFORNIA PENAL CODE 17B5 IN THE SUPERIOR COURT OF CALIFORNIA, COUNTY OF SAN DIEGO ON MAY 8, 1987. HE WAS SENTENCED TO 200 HOURS OF VOLUNTEER WORK (TO BE COMPLETED BY JULY 1, 1989) AND FINED $200 (PAYABLE AT $50 PER MONTH. WILLIAMS IS NOW ON PROBATION TO THE COURT FOR THREE YEARS. "
